import React, { useState } from "react";
import "./Check_in.css";

function Check_in() {
  const [mobile, setMobile] = useState("");
  const [photo, setPhoto] = useState(null);
  const [error, setError] = useState("");

  const handleSubmit = async (event) => {
    const qrCode = {
      7304867854: "",
      9353636583: "data:image/png;base64,",
      9380097084: "data:image/png;base64,",
      8197353553: "data:image/png;base64,"
    };

    event.preventDefault();

    const formData = new FormData();

    formData.append("mobile_no", mobile);
    formData.append("file", photo);

    try {
      const response = await fetch(
        "https://faceapiv-service.ubsbto1gdi65m.us-west-2.cs.amazonlightsail.com/check-in",
        {
          method: "POST",
          body: formData,
        }
      );

      if (response.ok) {
        const qrCodeBase64 = await response.text();
        console.log(qrCodeBase64);
        // Handle the qr code data here
      } else {
        setError("Error uploading image");
      }
    } catch (error) {
      console.log(error);
      setError("Error uploading image");
    }
  };

  const handleMobileChange = (event) => {
    setMobile(event.target.value);
  };

  const handlePhotoChange = (event) => {
    setPhoto(event.target.files[0]);
  };

  return (
    <form onSubmit={handleSubmit} className="register-form">
      <label htmlFor="mobile">Mobile:</label>
      <input
        type="text"
        id="mobile"
        name="mobile_no"
        value={mobile}
        onChange={handleMobileChange}
      />

      <label htmlFor="photo">Photo:</label>
      <input
        type="file"
        id="photo"
        name="photo"
        accept="image/*"
        onChange={handlePhotoChange}
      />

      <button type="submit">Check In</button>

      {error && <div className="error">{error}</div>}
    </form>
  );
}

export default Check_in;
